import { StyleSheet, Text, View } from 'react-native'
import React from 'react'
import { TextInput } from 'react-native-web'

const TestREDUX = () => {
  return (
    <View
      style={{
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
      }}
    >
      <TextInput
        style={{
          height: 40,
          borderColor: 'gray',
          borderWidth: 1,
        }}
      ></TextInput>
      <Text>TestREDUX</Text>
    </View>
  )
}

export default TestREDUX

const styles = StyleSheet.create({})
